import Grid from '@material-ui/core/Grid';
import {MDBContainer} from 'mdbreact';
import React from 'react';
import {Line} from 'react-chartjs-2';



export type LineChartVProps = {
  lineChartData:any;

}


const LineChartV = (props:LineChartVProps) => {
  return (
    <Grid item md={12}>

    <MDBContainer>
      <h3 >Activity</h3>
      <Line height={props?.lineChartData.height}  data={props?.lineChartData} options={{responsive: true}} />
    </MDBContainer>
    </Grid>
  );
};

export default LineChartV;
